def solve_quadratic_equation(a, b, c):
    D = b ** 2 + 4 * a * c
    if a == 0 and b == 0 and (c != 0):
        return (0, [])
    elif a == 0 and b == 0 and (c == 0):
        return (-1, [])
    elif a == 0:
        x0 = -c / b
        return (1, [round(x0, 5)])
    elif b == 0:
        if -c / a >= 0:
            x0 = (-c / a) ** 0.5
            return (1, [round(x0, 5)])
        else:
            return (0, [])
    elif D < 0:
        return (0, [])
    elif D == 0:
        x = -b / (2 * a)
        return (1, [round(x, 5)])
    else:
        x1 = (-b + D ** 0.5) / (2 * a)
        x2 = (-b - D ** 0.5) / (2 * a)
        roots = sorted([round(x1, 5), round(x2, 5)])
        return (2, roots)

